        "updated_at": "2015-02-15T10:23:32+00:00",
        "free_text": "https://www.facebook.com/events/335932023279581\nCraze Records et Bad Bear présentent :\n\nATLAS LOSING GRIP de retour à Paris, 3 ans après un concert mémorable aux Combustibles (RIP), avec les mêmes orgas, on est tellement cools ! \n\nIls viennent tout juste de sortir leur nouvel album qui s’annonce à n’en point douter comme l’un des disques de l’année ! Leur punkrock mélodique typique de la scène suédoise des années 90 prend ici des accents heavy metal bien sentis.\n\nhttps://www.facebook.com/atlaslosinggrip\nhttps://play.spotify.com/album/7CcvAJocz1NwFWgWXHBWA3?play=true&amp;utm_source=open.spotify.com&amp;utm_medium=open\n\n+ BURST ONE’S SIDE (punk-hardcore - 95 district)\n\nLa dernière fois qu’on les a fait jouer, c’était il y a 10 ans pour la 1e édition du Support Your Seine ! L’époque glorieuse de la scène parisienne (Wake ‘n Bake, M-Sixteen, Softworld, Jetsex,… RIP), souviens-toi. Ils ont décidé de rebrancher les amplis et sortent même un album !\n\nhttps://www.facebook.com/burstonesside\nhttp://burstonesside.bandcamp.com/\n\n+ PISS ME OFF (punkrock mélo - Paris)\n\npunkrock mélo 90s pour trentenaires nostalgiques. nouveau line-up, avec Vaness (The Mercenaries, ex The Black Stout) au chant pour un côté street punk !\n\nhttps://www.facebook.com/Pissmeoffparis\nhttp://pissmeoff.bandcamp.com/\n\n+ MEMORIES (modern hardcore - 95 district)\n\nPetits derniers de la très active scène valdoisienne, les Memories proposent un hardcore moderne extrêmement bien foutu.\n\nhttps://www.facebook.com/pages/Memories/335043893276793\nhttp://memories75.bandcamp.com/",
