        "free_text": "Sortez le cuir, les résilles, le vinyle, les loups et le make up ! \n\nLors du dark ball, en première partie de soirée, les danseurs Vogue &amp; Waack s'affronteront jusqu'à la transe dans des corps à corps puissants ! Le tout devant un jury impitoyable… Be nasty, be fierce ! \n\nCôté musique, la domination féminine sera de mise.\n\nInfluencée par l'incroyable collection de vinyles soul et funk de sa mère, LAKUTI devient DJ dans les 90's. Depuis 2007, elle manage le label/agence de booking Uzuri. Ses sets éclectiques ont de nombreuses fois fait vibrer le Panorama Bar.   \n\nLa jeune DJ MARINA TRENCH sera également derrière les platines. Après avoir passé 5 ans à Bordeaux, et joué notamment au côté de Jérémy My Love Is Underground, elle est de retour à Paris. \n\nEt pour que le plaisir reste intact, le résident NICK V ne vous laissera aucune minute de répit. Au service de ces dames, il imposera son style, armé de sa collection de disques et de son groove inné !",
