        "uid": "79534512",
        "image": "http://cibul.s3.amazonaws.com/event_swing-is-swag-release-party-wagram-music-compil-electroswing-vii_525001.jpg",
        "updated_at": "2014-08-12T15:22:59+00:00",
        "free_text": "Vendredi 26 septembre 2014 CONTRAST, COLORSWING &amp; WAGRAM MUSIC assiègent Le CABARET SAUVAGE pour la nouvelle SWING IS SWAG où quand l’esprit des années 1920,1930 rencontre le meilleur des musiques électroniques de ce début de siècle. \n\nA l’occasion de cet événement, SWING IS SWAG reçoit WAGRAM MUSIC pour la sortie de leur nouvelle compile ELECTRO SWING VII, sortie prévue le 22 septembre 2014\n \nPour cette édition nous pourrons compter sur la présence de GRAMOPHONEDZIE. Dj incontournable de la scène électro-swing Européenne, c’est une bouffée d’oxygène, avec des titres mélangeant funk, house, une pointe de jazz et des voix des années 50. Ses mixes donnent naissance à un cocktail explosif pour vous faire swinguer toute la nuit. Son titre sorti en 2010, Why Don’t You, eu un succès tel qu’il se plaça dans le top des charts anglais. \n\nDj TAVO le légendaire dj au 127 heures de mix sera des nôtres. Après avoir fait l’unanimité lors de ses prestations scéniques à travers le monde. Il enchantera de la même manière le public parisien, montrant sa légitimité comme l’un des 100 meilleurs dj’s du monde.\n \nLa France sera entre autre représentée par BART &amp; BAKER, pionniers de l'electro swing qui réalisent les célèbres compilations du même nom. Auteurs de remixes pour PAROV STELAR, CARAVAN PALACE, DIMITRI FROM PARIS, et même les PUPPINI SISTERS, leur style englobe le meilleur du swing et des productions actuelles. \nLa France sera également représentée par KIWISTAR déjà récompensé 3 fois aux électro swings awards, accompagné de JOSH LE CHAT.  \nNous aurons aussi le plaisir de compter parmi nous HANNA HAIS qui est une exception dans le monde de la musique électronique, elle est en effet la seule chanteuse de House en français. Devenu un des hymnes d’Ibiza, ‘Rosa Nova’ a été signé en exclusivité par le label anglais Defected, le plus gros label de House au monde. \nLIVE / DJS / SHOW VISUEL \n00H00 – 06H00 \nLE CABARET SAUVAGE Parc de la Villette, 211 Avenue Jean Jaurès, 75019 Paris http://www.cabaretsauvage.com/infos-pratiques/ \nFACEBOOK  https://www.facebook.com/events/701810296540223/\nPAF : 15e + com digitick : http://www.digitick.com/swing-is-swag-gramophonedzie-tavo-soiree-cabaret-sauvage-paris-26-septembre-2014-css4-digitick-pg101-ri2610386.html      // 20e sur place\n\nRELEASE PARTY POUR LA COMPILE ELECTRO-SWING VII \nELECTRO-SWING \n\nLe phénomène Electro Swing revient avec une Septième compilation chez Wagram Music Revisiter le swing des années 20 et Surfer sur les années Electro, c’est la recette du succès des compils électro-swing de WAGRAM MUSIC . \n\nLa compilation Electro Swing VII promet donc un mélange de multiples influences, un retour nostalgique aux années du swing qui s’inscrit pourtant dans la modernité avec des rythmes dynamiques, lounge, chic et glamour\n**GRAMOPHONEDZIE (Belgrade)\n Positiva/Virgin, Guesthouse, DiskoZoo, Nocturnal Groove \nHOUSE SWING\nhttps://soundcloud.com/gramophonedzie \nwww.facebook.com/thegramophonedzie \nwww.gramophonedzie.com \nhttps://www.youtube.com\n**TAVO (Colombie) \n3Star Deluxe/Muzik X Press/Supermarket Unlimited/Take Away/Vendetta Clubstream/Avenue/Adverso \nTECHNO SWING / ELECTRO SWING\nhttps://soundcloud.com/tavo \nhttps://www.facebook.com/TavotheOne \nhttp://www.deezer.com/artist/1081500\n**BART &amp; BAKER (France) \nWagram Music \nELECTRO-SWING / CLUB JAZZ\nwww.bartandbaker.com \nhttps://soundcloud.com/bartandbaker\n\n**KIWISTAR (France) \nTha Groovy Bastard / Green Queen Music \nELECTRO-SWING / SWING’N’BASS\n\nhttps://soundcloud.com/kiwistar \n\n\n**JOSH &amp; LE CHAT (UK) \nELECTRO-SWING \n\nhttp://soundcloud.com/joshtorrent\n\n**HANNA HAIS (FR) \nAtal Music, Defected, KingStreet\n\nwww.hannahais.com \nwww.facebook.com/hannahais1 \nwww.mix.dj/HannaHais",
