        "department": "Paris",
        "link": "http://openagenda.com/event/bye-bye-ocean_834",
        "free_text": "Janvier est déjà là, 2015 aussi. Tu es triste et heureux à la fois, c’est bizarre, mais comme d’hab en fait. Quand tu te regardes dans le miroir, tu vois l’océan, mais ça aussi c’est normal. La BBO n’est pas loin, tu le sais, tu le sens…\n\nVenu tout droit des terres obscures d’outre-Manche, VISIONIST (Pan / Diskotopia - UK) est un virtuose hors format qui se situe quelque part entre Fatima Al Qadiri, Oneohtrix Point Never et Jam City. Ce génial orfèvre grime bass usera de son savoir faire pour délivrer un special upbeat set. Venez tâter le future club.\n\nQui, depuis quelques mois, remet en place la scène musicale parisienne ? Qui impose une future pop, vaporwave, future beats ? AAMOUR OCEAN (Ventura records - FR) ! Ces jeunes virtuoses seront en live à la Bye Bye Ocean… Levez la tête, fermez les yeux.\n\nFraichement arrivé de New York, et nouvellement signé chez 100% Silk et Icee Hot, BOBBY BROWSER (100% Silk / Icee Hot - US), jeune trublion ghetto house / ghetto bass inspiré par Chicago, n’en est pas à son premier tour de passe-passe. Cet artiste à suivre de près, et dont la connaissance discographique fait foi, jouera une sélection enchanteresse située quelque part entre futurisme et vintage analo.\n\nAPRILE, ex-deBonton et actuel boss de Permalnk et Bye Bye Ocean, vous accueille à chaque édition de la BBO. Il trouvera la force et le ton pour vous emmener loin, là où les cétacés meurent en paix. Loin de la terre, de l’asphalte et des autolibs.",
