        "link": "http://openagenda.com/event/rhythm-and-girls-aux-trois-baudets",
        "free_text": "Le Fake vous donne rendez-vous aux Trois Baudets, le 29 Novembre 2014, pour découvrir Les Akouphènes et le Hip-Tap Project de Leela Petronio... Participation de l'artiste pop art Benoit JAMMES qui exposera ses oeuvres.\n\nPlus qu’un concert, c’est une CAPTATION LIVE avec Interviews en DIRECT… pour réaliser 3 Concert-HDs exclusifs sur RhythmAndTown.com, accessibles en préventes !\n\nBilletterie &amp; Concert-HD sur http://rhythmandtown.com/concert-a-paris/rhythm-and-girls-aux-3-baudets\nFB : https://www.facebook.com/events/343762522454889/\n\nHIP TAP PROJECT : Boom Tchak!\nLes pieds parlent, les mains s’expriment, les corps résonnent, la voix s’en mêle dans une joyeuse et dynamique rencontre autour du rythme.\nCette performance est un mélange d’extraits du répertoire de la compagnie .\nDirectrice artistique : Leela PETRONIO\n\nLes AKOUPHENES : spécial sortie d'EP\n\nLes deux filles nous distillent une Pop percussive impressionnante et fraiche, un joli mélange de chant, d’effets et d’influences orientales. Entre sensualité et textes piquants, si vous pensiez encore que la scène française ne parvenait plus à innover Les Akouphènes devraient vous faire changer d'avis. Leur son ne sera pas sans vous rappeler Camille ou encore le travail des voix dans Brigitte, notamment sur scène où les boucles se mêlent au chant puissant de Malory et aux envolées rythmiques de Mispad !",
        "address": "64 bd de Clichy, Paris 75018",
