        "title": "Under Kontrol (libe beatbox) &amp; Emii (Dj set &amp; MPC)",
        "pricing_info": "Entrée libre",
        "image": "http://cibul.s3.amazonaws.com/event_under-kontrol-live-beatbox-dj-emii-dj-mpc_980534.jpg",
        "date_start": "2015-06-21",
        "updated_at": "2015-06-09T12:56:43+00:00",
        "space_time_info": "Médiathèque Marguerite Duras, le dimanche 21 juin 2015 à 17:00",
        "timetable": "2015-06-21T17:00:00 2015-06-21T19:30:00",
        "department": "Paris",
        "link": "http://openagenda.com/event/under-kontrol-live-beatbox-dj-emii-dj-mpc",
        "free_text": "Under Kontrol, ce combo, composé de Micflow, Mr. Lips, Tiko et Fayabraz, c’est le All Star du Beatbox français. Leur album, intitulé 1, est donc le premier du genre, 100% Beatbox.\nSans machines, sans platines, sans effets, et avec la voix pour seul instrument, ils produisent un hip hop aérien aux rythmiques implacables. À la manière de Turntablists/Dj's, les quatre activistes superposent et entrechoquent les samples, rajoutent leurs scratchs vocaux pour aboutir à un mix précis et puissant, réglé jusqu'à la perfection.\nL'objectif étant donc d'installer confortablement l'auditeur dans leur auberge espagnole du beat, ourlée d'ambiances diablement organiques, furieusement ludiques pour tout dire...  Le second album est en préparation !\nhttps://www.facebook.com/UNDERKONTROLFANPAGE\nhttps://soundcloud.com/under-kontrol\nhttps://www.youtube.com/user/UNDERKONTROLVIDEOS\nhttp://www.underkontrol.net/\n\nEmii (Dj set &amp; MPC) : un chignon vissé sur la tête qui nous rappelle l'épopée rétro des grandes divas, Dj Emii a baigné dans un milieu artistique dès son plus jeune âge. Influencée par ses frères et sœurs qui pratiquaient eux-mêmes l'art de la danse et de la musique. A cette époque la Black Music résonnait dans toute la maison. Sa voie se dirigeait vers une carrière footballistique mais le destin en a décidé autrement, la magie de ses pieds laisse place à la magie de ses mains. Sa forte personnalité est le fruit de son style musical, notre DJ -productrice aime remettre les sons d'hier au goût du jour. Son set est un mélange entre Garage, Soul, Rhythm and Blues, Hip-hop and African deep house.\nhttps://www.facebook.com/pages/DJ-EMII/195388073966943?fref=ts\nhttps://soundcloud.com/houseonly69\n\nvisuel: © Vincent Castellin",
        "placename": "Médiathèque Marguerite Duras",
